			shellPath = /bin/sh;
			shellScript = "# Merge Script\n\n# 1\n# Set bash script to exit immediately if any commands fail.\nset -e\n\n# 2\n# Setup some constants for use later on.\nWORKSPACE_NAME=\"Voxbone\"\nFRAMEWORK_NAME=\"VoxboneSDK\"\n\n# 3\n# If remnants from a previous build exist, delete them.\nif [ -d \"${SRCROOT}/build\" ]; then\nrm -rf \"${SRCROOT}/build\"\nfi\n\n# 4\n# Build the framework for device and for simulator (using\n# all needed architectures).\nxcodebuild -workspace \"../${WORKSPACE_NAME}.xcworkspace\" -scheme \"${FRAMEWORK_NAME}\" SYMROOT=$(PWD)/build -configuration Release -arch arm64 -arch armv7 only_active_arch=no defines_module=yes -sdk \"iphoneos\" VALID_ARCHS=\"arm64 armv7 armv7s\"\nxcodebuild -workspace \"../${WORKSPACE_NAME}.xcworkspace\" -scheme \"${FRAMEWORK_NAME}\" SYMROOT=$(PWD)/build -configuration Release -arch x86_64   only_active_arch=no defines_module=yes -sdk \"iphonesimulator\" VALID_ARCHS=\"x86_64 i386\"\n\n# 5\n# Remove .framework file if exists from previous run.\nif [ -d \"../VoxboneDemo/VoxboneDemo/VoxboneSDK/${FRAMEWORK_NAME}.framework\" ]; then\nrm -rf \"${FRAMEWORK_NAME}.framework\"\nfi\n\n# 6\n# Copy the device version of framework.\ncp -r \"${SRCROOT}/build/Release-iphoneos/${FRAMEWORK_NAME}.framework\" \"../VoxboneDemo/VoxboneDemo/VoxboneSDK/${FRAMEWORK_NAME}.framework\"\n\n# 7\n# Replace the framework executable within the framework with\n# a new version created by merging the device and simulator\n# frameworks' executables with lipo.\nlipo -create -output \"../VoxboneDemo/VoxboneDemo/VoxboneSDK/${FRAMEWORK_NAME}.framework/${FRAMEWORK_NAME}\" \"${SRCROOT}/build/Release-iphoneos/${FRAMEWORK_NAME}.framework/${FRAMEWORK_NAME}\" \"${SRCROOT}/build/Release-iphonesimulator/${FRAMEWORK_NAME}.framework/${FRAMEWORK_NAME}\"\n\n# 8\n# Copy the Swift module mappings for the simulator into the\n# framework.  The device mappings already exist from step 6.\ncp -r \"${SRCROOT}/build/Release-iphonesimulator/${FRAMEWORK_NAME}.framework/Modules/${FRAMEWORK_NAME}.swiftmodule/\" \"../VoxboneDemo/VoxboneDemo/VoxboneSDK/${FRAMEWORK_NAME}.framework/Modules/${FRAMEWORK_NAME}.swiftmodule\"\n\n# 9\n# Delete the most recent build.\nif [ -d \"${SRCROOT}/build\" ]; then\nrm -rf \"${SRCROOT}/build\"\nfi";
